import React, { useState } from "react";

export default function Comp1() {
  const [dataarray, setdataarray] = useState([
    { Nom: "youssef", prenom: "boughanem", age: "21ans" },
    { Nom: "mohamed", prenom: "elmrini", age: "21ans" },
    { Nom: "yassine", prenom: "ziat", age: "21ans" },
  ]);

  return (
    <div>
      <h1>Liste des étudiants</h1>
      <table>
        <thead>
          <tr>
            <th>Nom</th>
            <th>Prénom</th>
            <th>Age</th>
          </tr>
        </thead>
        <tbody>
          {dataarray.map((el, index) => (
            <tr key={index}>
              <td>{el.Nom}</td>
              <td>{el.prenom}</td>
              <td>{el.age}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
